import React, { useState } from 'react'
import './Strenghts.css'

function Strenghts({ strenghts }) {

    const [current, setCurrent] = useState(0);
    const [value, setValue] = useState(0);


    if (!Array.isArray(strenghts) || strenghts.length <= 0) {
        return null;
    }
    return (
        <div className="bg-gray">
            <div className="strengths container">
                <div data-spy="scroll" data-target="#list-example" data-offset="0" class="scrollspy-example">

                    <p id="list-item active">The software development process is managed with a project-oriented approach: on this purpose we use Project Objects (PO), an innovative and powerful Enterprise Project Intelligence platform. PO is our key ally for the management and control of projects and for the exchange of information with our clients. Using a project oriented approach grants rigorous compliance with approved budget and in-time deliveries.</p>
                    <p id="list-item-2">We are familiar to working with big corporations feeling overwhelmed by too much rigidity and bureaucracy; what they need is a flexible partner to work with.</p>
                    <p id="list-item-3">On the side of project management, Project Object, the Project Intelligence platform we use, is the means that allows an easy exchange of information with our clients: we can easily deliver timesheets and attach documents.</p>
                    <p id="list-item-4">The success of projects is supported by the assignment of roles based on RACI principles; in every project we identify the persons who</p>
                </div>
                <div id="list-example" class="list-group">
                    {strenghts.map((strenght, index) => {
                        return (
                            <a className={index === current ? 'list-group-item list-group-item-action active' : 'list-group-item list-group-item-action '} href="#">{strenght.title}</a>
                        );
                    })}
                </div>
            </div>
        </div>
    )
}

export default Strenghts;
